import React from 'react';
import SayMyName from './SayMyName';
import Pessoa from './Pessoa';
function HelloWord() {
    return (
        <section>
            <h1>wow wow</h1>
            <Pessoa nome = 'andere'/>
            <SayMyName nome = 'matheus'/>
            <SayMyName nome = 'caue'/>
        </section>
    )
}
export default HelloWord
